import './App.css';
import { BrowserRouter as Router } from 'react-router-dom';
import Navbar from './components/navbar';
import Dashboard  from './components/dashboard';

function App() {

  return (
    <div className="app">
        <Router>
          <Navbar />
          <Dashboard />
        </Router>
    </div>
  );
};

export default App;
